import React from "react";

const ContactList = ({contacts}) => {
    return <div>
        <ul>
            {contacts.map(({ name, number, sex }) => (
                <li>
                    <span>name: {name}</span>
                    <span>number: {number}</span>
                    <span>sex: {sex}</span>
                </li>
            ))}
        </ul>
    </div>
}

export default ContactList
